INSERT INTO `categories` (`id`, `title`, `description`, `kit_html`, `other_html`, `cost`, `img`) VALUES
(1, 'Интернет-магазины', 'Создание интернет-магазина – кропотливый и трудоемкий процесс. От момента первого наброска до первой покупки проходят десятки операций, направленных на оптимизацию работы Вашего ресурса. Чтобы заказать интернет магазин Вам достаточно иметь идею и интересный товар. Остальным займется студия разработки Strything. Амазон мы конечно не сделаем, но можем попробовать сделать лучше.   ', '<p>В комплекте идут:<br/></p>\r\n<p>\r\n• Мобильная адаптация<br/>\r\n• Индивидуальный дизайн каждого блока <br/>\r\n• Индексация поисковыми системами<br/>\r\n• Настройка форм обратной связи<br/>\r\n• Настройка контактов и соц. сетей<br/>\r\n• Подготовка анимаций<br/>\r\n• Настройка онлайн-оплаты<br/>\r\n• Подвязка платежных систем<br/>\r\n• Интеграция с почтовыми ресурсами<br/>\r\n• Удобная форма для выгрузки товаров<br/>\r\n• Постановка на домен и хостинг<br/>\r\n• Подвязка Google-аналитики\r\n</p>', '<p>\r\n• Настроить рекламу Google/Yandex/FB<br/>\r\n• Провести SEO-оптимизацию сайта<br/>\r\n• Подготовить текста<br/>\r\n• Выгрузить товары<br/>\r\n• Провести интеграцию с 1С\r\n</p>', 700, );
INSERT INTO `categories` (`id`, `title`, `description`, `kit_html`, `other_html`, `cost`, `img`) VALUES
(2, 'Корпоративные сайты', 'Заказать корпоративный сайт – и быть им недовольным, это все равно, что каждый день смотреть в зеркало с ненавистью к самому себе. Ваш ресурс во всемирной паутине – это Ваше лицо, и оно должно быть идеальным, если вы хотите что-то продать. Если Вы не умеете правильно делать макияж, то вы идете к стилисту. По сути, мы-стилисты в мире веб-разработки, и мы точно сможем сделать так, чтобы вы были неотразимы.', '<p>В комплекте идут:<br/></p>\r\n<p>\r\n• Мобильная адаптация<br/>\r\n• Индивидуальный дизайн каждого блока<br/>\r\n• Индексация поисковыми системами<br/>\r\n• Постановка на CMS (При необходимости)<br/>\r\n• Подбор фото<br/>\r\n• Настройка форм обратной связи<br/>\r\n• Настройка контактов и соц. сетей<br/>\r\n• Подготовка анимаций<br/>\r\n• Постановка на домен и хостинг<br/>\r\n• Подвязка Google-аналитики\r\n</p>', '<p>\r\n• Добавить функцию оплаты онлайн<br/>\r\n• Настроить рекламу Google/Yandex/FB<br/>\r\n• Провести SEO-оптимизацию сайта<br/>\r\n• Подготовить текста\r\n</p>', 300, );
INSERT INTO `categories` (`id`, `title`, `description`, `kit_html`, `other_html`, `cost`, `img`) VALUES
(3, 'Мобильные приложения', 'Создание мобильного приложения — это не только часть имиджа успешной компании, но и элемент для привлечения новых пользователей. У нас вы сможете заказать мобильное приложение для IOS и Andoid, которое будет не только частью Вашего бренда, но и станет платформой для новых возможностей, поиска новых клиентов и новых площадок для рекламы, но как говориться «You never gonna know if you never even try».', '<p>С чем работаем:<br/></p>\r\n• Swift<br/>\r\n• Java<br/>\r\n• JS/HTML5<br/>\r\n• Python<br/>\r\n• C#<br/>\r\n• Xamarin<br/>\r\n• .NET<br/>', NULL, 200, );
INSERT INTO `categories` (`id`, `title`, `description`, `kit_html`, `other_html`, `cost`, `img`) VALUES
(4, 'Продвижение в сети', 'Для начала успешного дела во всемирной паутине – мало только заказать сайт. Нужно позаботиться о его продвижении в сети, и рекламе. Порой эти затраты в несколько раз превышают таковые на разработку ресурса, однако при грамотном подходе – результат с лихвой окупает затраты на продвижение сайта. Мы обеспечим Вас грамотным SEO-продвижением и качественной рекламной кампанией.  ', '<p>С чем работаем:<br/></p>\r\n• Комплексное SEO-продвижение<br/>\r\n• Настройка Яндекс рекламы<br/>\r\n• Настройка Google рекламы<br/>\r\n• Таргетированная реклама Facebook<br/>', NULL, 500, );

